import React from "react";

const Header = () => {
    

    return (
        <>
            <div className='flex flex-row items-center align-middle h-[10vh] p-4'>

                <img src="./images/logo.png" width={"60px"}/>
                <p className="px-2" >Femmes d'histoire</p>
            </div>            
        </>
    );
};

export default Header;
